webpackJsonp([0xc06e29d9f3a5],{8318:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Sticky Hardware",date:"11 Jan 2006",slug:"/2006-01-11-sticky-hardware/",tags:"Y2006"},html:"<p>This week we threw some more hardware at blogg.de and the other websites hosted by nu2m. This time it seems to be sticking to the wall (like <a href=\"http://photomatt.net/2006/01/05/wpcom-performance/\">noodles</a> when they're done). 12 must be our lucky number:</p>\n<ul>\n<li>6 webservers</li>\n<li>3 database servers</li>\n<li>2 load balancers</li>\n<li>and a firewall in a pear tree</li>\n</ul>\n<p>The rack isn't full yet, but the switch and the power strips are now maxed out. </p>"},next:{fields:{title:"SkyScout",date:"08 Jan 2006",slug:"/2006-01-08-skyscout/"}},previous:{fields:{title:"Technical Translation",date:"11 Jan 2006",slug:"/2006-01-11-technical-translation/"}}},{node:{fields:{title:"SkyScout",date:"08 Jan 2006",slug:"/2006-01-08-skyscout/",tags:"Y2006"},html:'<p>I usually don\'t get excited about gadgets, but the <a href="http://www.celestron.com/skyscout/hp_land.php">SkyScout</a> is a telescope that tells you what you\'re looking at which sounds pretty <a href="http://scobleizer.wordpress.com/2006/01/07/the-word-of-mouth-killer-product-of-ces/" title="Scobleizer - Microsoft Geek Blogger &raquo; The word-of-mouth killer product of CES">cool</a> to me.</p>'},next:{fields:{title:"The Hammer",date:"07 Jan 2006",slug:"/2006-01-07-the-hammer/"}},previous:{fields:{title:"Sticky Hardware",date:"11 Jan 2006",slug:"/2006-01-11-sticky-hardware/"}}},{node:{fields:{title:"The Hammer",date:"07 Jan 2006",slug:"/2006-01-07-the-hammer/",tags:"Y2006"},html:'<p>My wife isn\'t usually very interested in my work, but she was looking for a quick trip to someplace warm and turned to <a href="http://weg.de/" title="weg.de - Ihr neues Reiseb&uuml;ro im Internet">weg.de</a>, our travel portal. Suddenly she exclaimed "That\'s the <a href="http://dict.leo.org/?search=Das+ist+ja+der+Hammer" title="Das ist ja der Hammer!">hammer!</a> Two clicks and I\'m where I want to be!" Well, weg.de is pretty easy to use. I didn\'t even tell her to check there, so all those <a href="http://www.robertundhorst.de/v2/kre_client.php?id=7&amp;pid=25">billboards</a> must be working.</p>'},next:{fields:{title:"Knut",date:"07 Jan 2006",slug:"/2006-01-07-knut/"}},previous:{fields:{title:"SkyScout",date:"08 Jan 2006",slug:"/2006-01-08-skyscout/"}}}],pathPrefix:"",first:!1,last:!1,index:250,pageCount:1101}}}});
